import Raect, { Component } from 'react';
import "./product-condensed.css";

class ProductCondensed extends Component {
  render() {
    return (
      <li cclass="list-group-item">
        <a className="btn btn-outline-danger"> X </a><p>{this.props.product.title} | <b>${this.props.product.price}</b></p>
        { <p>{this.props.product.title} momo| <b>${this.props.product.price}</b></p> }
      </li>
    );
  }
}

export default ProductCondensed;
